        Use this button to lockdown the station. It will close the blast doors to all 4 access points from the boarding hallways. It should be used on discretion if the station is being boarded or invaded by the enemy organization.


        Remember to also lockdown the station's windows with lockdown buttons in other locations:


        1) Lockdown button next to bar windows will lockdown the windows at bar.

        2) Lockdown button in security's security sergeant office will lockdown the windows and exterior airlock access at the arrivals.

        3) Lockdown button in the engineering maintenance will lockdown the windows and exterior airlock access to engineering maintenance.

        4) Lockdown button next to cargo windows will lockdown the windows at the cargo.


        This is very important as enemy organization might use windows to invade the station and circumvent the main lockdown.
